import React from 'react';
import Navbar from './components/Navbar/Navbar';

class App extends React.Component {
  render() {
    return (
      <div className='p-2 sm;p-4 sm:mx-auto'>
        <Navbar />
      </div>
    )
  }
}

export default App;
